import styled from '@emotion/styled';

const MapPage = () => {
  let ar = [10, 20, 30];
  let res = ar.map(() => {
    return 5;
  });
  console.log(res);

  let ar2 = [<h2>title</h2>, <h2>title2</h2>, <p>안녕하세요</p>];

  let todoList = [
    'java study',
    'html study',
    'css study',
    'team study',
    'k',
    'kkk',
    'kkkkk',
    'kkkkkkkk',
    'lkkkkkkkkkk',
  ];

  let list = todoList.map((element) => {
    return element - 1;
  });

  console.log(list);

  return (
    <>
      <h1>map function</h1>
      <h2> {res} </h2>
      <h2> {ar2} </h2>
      <h2> {list} </h2>
      <WriteWrap>dd</WriteWrap>
    </>
  );
};

const WriteWrap = styled.div`
  background-color: skyblue;
  border-radius: 20px;
  box-shadow: pink;
  width: 80%;
  margin: 0 auto;
`;

export default MapPage;
